oxy_webhelp_navlinks = {"tasks_notes-d4800e2004":{"topics":[{"title":"Creating a TeamRoom","shortdesc":"<p class=\"shortdesc\">Create a TeamRoom application to create a place where you and your team members can store documents, share information, and collaborate with one another.<\/p>","href":"trm_create_teamroom_t.html","attributes":{"data-id":"trm_create_teamroom_t"},"menu":{"hasChildren":false},"tocID":"trm_create_teamroom_t-d4800e2015","topics":[]},{"title":"Setting up the TeamRoom","shortdesc":"<p class=\"shortdesc\">The TeamRoom setup serves as the foundation for TeamRoom. By completing the Setup, you configure and customize TeamRoom for your team's use.<\/p>","href":"trm_set_up_teamroom_t.html","attributes":{"data-id":"trm_set_up_teamroom_t"},"menu":{"hasChildren":false},"tocID":"trm_set_up_teamroom_t-d4800e2026","topics":[]},{"title":"Maintaining the TeamRoom ","shortdesc":"<p class=\"shortdesc\">The procedures that follow are tasks necessary for the Team Facilitator to perform in order to effectively manage and maintain a TeamRoom. For additional information about maintaining a TeamRoom, click <span class=\"ph menucascade\"><span class=\"ph uicontrol\">Help<\/span><abbr title=\"and then\"> &gt; <\/abbr><span class=\"ph uicontrol\">Using This Application<\/span><\/span>.<\/p>","href":"trm_maintain_teamroom_t.html","attributes":{"data-id":"trm_maintain_teamroom_t"},"menu":{"hasChildren":false},"tocID":"trm_maintain_teamroom_t-d4800e2037","topics":[]},{"title":"Archiving TeamRoom documents","shortdesc":"<p class=\"shortdesc\">After a set of archiving criteria has been created and enabled for your TeamRoom application, you can mark documents as expired on a specific date. Archiving documents decreases the size of the TeamRoom, which improves performance.<\/p>","href":"trm_archive_teamroom_docs_c.html","attributes":{"data-id":"trm_archive_teamroom_docs_c"},"menu":{"hasChildren":false},"tocID":"trm_archive_teamroom_docs_c-d4800e2065","topics":[]}]}};